/**
 * Class for getting data about User.
 * @author Jérôme Brenier
 */
@Singleton
public class DAOUserImpl implements DAOUser {

    @Inject
    public DAOUserImpl() {
    }

    /**
     * Get the User corresponding to given credentials (email and password). Return null if
     * credentials invalid.
     *
     * @param email    of the user
     * @param password of the user
     * @return the User
     */
    public User getByCredentials(String email, String password) {
        String storedPassword = getUserPasswd(email);
        if (storedPassword != null && verifyPassword(password, storedPassword)) {
            String image = "";
            Photo photo = new Photo("idPhoto", image);
            Pet toto = new Pet("idToto", "toto", null, null, null, null);
            Pet titi = new Pet("idTiti", "titi", null, null, null, null);
            List<Pet> petOwned = Arrays.asList(toto, titi);
            User test = new User("idTest", "Claire", "test@test.fr", "password",
                    photo, petOwned, null);
            return test;
        }
        return null;
    }

    public String getUserPasswd(String email) {
        return "test";
    }

    public boolean verifyPassword(String passwordToCheck, String storedPassword) {
        return true;
    }
}
